import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import Home from './components/Home';
import Prices from './components/Prices';
import Calendar from './components/Calendar';
import Booking from './components/Booking';
import Contact from './components/Contact';
import Classes from './components/Classes';

function App() {
  return (
    <Router>
      <nav style={{ padding: '1rem', backgroundColor: '#eee' }}>
        <Link to="/" style={{ marginRight: '1rem' }}>Accueil</Link>
        <Link to="/prices" style={{ marginRight: '1rem' }}>Tarifs</Link>
        <Link to="/calendar" style={{ marginRight: '1rem' }}>Horaire</Link>
        <Link to="/booking" style={{ marginRight: '1rem' }}>RÃ©server</Link>
        <Link to="/classes" style={{ marginRight: '1rem' }}>Cours</Link>
        <Link to="/contact">Contact</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/prices" element={<Prices />} />
        <Route path="/calendar" element={<Calendar />} />
        <Route path="/booking" element={<Booking />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/classes" element={<Classes />} />
      </Routes>
    </Router>
  )

}

export default App;
